import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer id="footer">
      <div id="bottomMenu">
        <a className="bottomMenuItem" href="Index.html">Home</a>
        <a className="bottomMenuItem" href="About.html">About</a>
        <a className="bottomMenuItem" href="Insights.html">Insights</a>
        <a className="bottomMenuItem" href="Support.html">Support</a>
        <a className="bottomMenuItem" href="Contact.html">Contact</a>
      </div>
    </footer>
  );
}

export default Footer;
